import { nanoid } from "nanoid";

export default function FalseSquare(props) {
    return (
        <button 
            className="false-square"
            value={props.value}
            onClick={() => props.handleClick(props.id, props.rowId)}
            id={props.id}
            key={nanoid()}
        ></button>
    );
}
